import React, { useState, useEffect } from "react";
import {
    LineChart,
    Line,
    XAxis,
    YAxis,
    Tooltip,
    CartesianGrid,
    ResponsiveContainer,
    BarChart,
    Bar
} from "recharts";

const Statistiques = () => {
    const [calendarData, setCalendarData] = useState([]);
    const [seancesData, setSeancesData] = useState([]);
    const [seancesParMois, setSeancesParMois] = useState([]);
    const [seancesJanvier, setSeancesJanvier] = useState([]);

    // Charger les donnÃ©es depuis les API
    useEffect(() => {
        const fetchCalendarData = fetch("http://localhost:5000/api/calendar").then((res) => {
            if (!res.ok) throw new Error(`HTTP error! Status: ${res.status}`);
            return res.json();
        });

        const fetchSeancesData = fetch("http://localhost:5000/api/seances").then((res) => {
            if (!res.ok) throw new Error(`HTTP error! Status: ${res.status}`);
            return res.json();
        });

        Promise.all([fetchCalendarData, fetchSeancesData])
            .then(([calendar, seances]) => {
                setCalendarData(calendar);
                setSeancesData(seances);

                // Calculer les sÃ©ances par mois
                const seancesParMoisCalc = calendar.reduce((acc, item) => {
                    const month = new Date(item.date).getMonth();
                    acc[month] = acc[month] ? acc[month] + 1 : 1;
                    return acc;
                }, Array(12).fill(0));

                const formattedData = seancesParMoisCalc.map((count, index) => ({
                    mois: new Date(2025, index).toLocaleString("fr-FR", { month: "long" }),
                    totalSeances: count,
                }));

                setSeancesParMois(formattedData);

                // Calculer les occurrences des sÃ©ances uniquement pour janvier
                const seancesEnJanvier = calendar.filter((item) => new Date(item.date).getMonth() === 0);

                const seancesCount = seancesEnJanvier.reduce((acc, item) => {
                    const seance = seances.find((s) => s.id === item.seanceId);
                    const nom = seance ? seance.nom : "SÃ©ance inconnue";
                    acc[nom] = (acc[nom] || 0) + 1;
                    return acc;
                }, {});

                const formattedJanvierData = Object.keys(seancesCount).map((nom) => ({
                    nom,
                    total: seancesCount[nom],
                }));

                setSeancesJanvier(formattedJanvierData);
            })
            .catch((err) => console.error("Erreur lors du chargement des donnÃ©es :", err));
    }, []);

    return (
        <div className="statistiques-container p-8 space-y-10">
            {/* Graphique des sÃ©ances par mois */}
            <div className="bg-white rounded-2xl shadow-lg p-6">
                <h2 className="text-xl font-semibold text-gray-800 mb-4">ðŸ“… Nombre total de sÃ©ances par mois</h2>
                <ResponsiveContainer width="100%" height={400}>
                    <LineChart data={seancesParMois}>
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="mois" tick={{ fill: "#4A5568" }} />
                        <YAxis tick={{ fill: "#4A5568" }} />
                        <Tooltip />
                        <Line type="monotone" dataKey="totalSeances" stroke="#4F46E5" strokeWidth={3} />
                    </LineChart>
                </ResponsiveContainer>
            </div>

            {/* Graphique des types de sÃ©ances en janvier */}
            <div className="bg-white rounded-2xl shadow-lg p-6">
                <h2 className="text-xl font-semibold text-gray-800 mb-4">ðŸ“Š RÃ©partition des sÃ©ances en janvier</h2>
                <ResponsiveContainer width="100%" height={400}>
                    <BarChart data={seancesJanvier}>
                        <CartesianGrid strokeDasharray="3 3" />
                        <XAxis dataKey="nom" tick={{ fill: "#4A5568" }} interval={0} angle={-45} textAnchor="end" />
                        <YAxis tick={{ fill: "#4A5568" }} />
                        <Tooltip />
                        <Bar dataKey="total" fill="#10B981" barSize={50} />
                    </BarChart>
                </ResponsiveContainer>
            </div>
        </div>
    );
};

export default Statistiques;
